import React from 'react';
import './Sidebar.css';

const Sidebar = () => {
  const menuItems = [
    { icon: 'üìÖ', label: 'Bookings', active: true },
    { icon: 'üë•', label: 'Staff' },
    { icon: 'üí∞', label: 'Sales' },
    { icon: 'üßë‚Äç‚úàÔ∏è', label: 'Members' },
    { icon: 'üìä', label: 'Reports' },
    { icon: '‚úàÔ∏è', label: 'Aircraft' },
    { icon: '‚öôÔ∏è', label: 'Settings' },
  ];

  return (
    <div className="sidebar">
      <div className="sidebar-header">
        <img src="/your-logo.png" alt="Aeroclub Logo" className="logo" />
        <h2>Aeroclub</h2>
      </div>
      <nav className="sidebar-nav">
        {menuItems.map((item) => (
          <button
            key={item.label}
            className={`nav-item ${item.active ? 'active' : ''}`}
            onClick={() => console.log(`Navigating to ${item.label}`)}
          >
            <span className="nav-icon">{item.icon}</span>
            <span className="nav-label">{item.label}</span>
          </button>
        ))}
      </nav>
    </div>
  );
};

export default Sidebar;
